tables.table_schema:
CREATE TABLE LogisticsInformation (
  shipment_id INT,
  product_name VARCHAR,
  quantity INT,
  destination_address VARCHAR
);

CREATE TABLE FinancialData (
  invoice_id INT,
  transaction_date DATE,
  amount DECIMAL,
  currency VARCHAR
);

CREATE TABLE SupplyChainCosts (
  cost_id INT,
  cost_type VARCHAR,
  cost_amount DECIMAL,
  description TEXT
);

CREATE TABLE Profitability (
  profit_id INT,
  revenue DECIMAL,
  expenditure DECIMAL,
  profit_margin DECIMAL
);

CREATE TABLE logistics_info (
    entry_id INT PRIMARY KEY,
    product_name VARCHAR,
    quantity INT,
    unit_price DECIMAL
);
